import { CheckIcon } from "@heroicons/react/solid";
import Event from "../assets/envitedImg.png";
import React from "react";

const Pricing = () => {
  return (
    <div id="main" className="w-full bg-[#F6F2FF]">
      <div className="max-w-[1240px] mx-auto">
        <div className="text-center antialiased">
          <h1 className="text-5xl font-semibold">
            Imagine If <br />
            <span className="text-5xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-[#8456EC] to-[#E87BF8]">
              Snapchat
            </span>
            <br /> had events.
          </h1>
          <p className="font-light text-slate-700 my-4">
            Easily host and share events with your friends <br /> accross any
            social media.
          </p>
        </div>
        <div className="flex flex-col justify-center items-center">
          <img
            src={Event}
            className="w-1/4 h-full object-cover rounded-xl"
            alt="/"
          />
          <button className="py-4 mb-4 w-1/5">Get Started</button>
        </div>
      </div>
    </div>
  );
};

export default Pricing;
